svg.script:
    
	 var myMapApp = new mapApp(false, undefined); //与tooltip相关
    var obc; //
    window.onSVGLoad = initLater();
    function initLater() {
        //this timeout is because of the bbox bug in Firefox which prevents to have access to bbox in onload scripts
        window.setTimeout("init()", 100);
    }
    function init() {

         /* 添加tooltip*/
         //tooltip styles
         var tooltipTextStyles = {
             "font-family": "Arial,Helvetica",
            "fill": "dimgray",
            "font-size": 1300
        };
        var tooltipRectStyles = {
             "fill": "white",
            "stroke": "dimgray"
        };
         myMapApp.initTooltips("toolTip", tooltipTextStyles, tooltipRectStyles, 10, 20, 3);
         //add tooltip to element
         myMapApp.addTooltip("layer_1", undefined, true, false, "target", "name");
		 myMapApp.addTooltip("lunkuo", undefined, true, false, "target", "name");

   

    var lunkuo = document.getElementById("lunkuo");
    var childa = lunkuo.firstChild;
    while (childa != null) {
        childa.addEventListener("mouseover", LevelHighlight, false);
        childa.addEventListener("mouseout", LevelHighlightRecover, false);
        childa = childa.nextSibling;
    }
	}
	function LevelHighlight(evt) {
	 	var obj = evt.target;
	    obj.setAttributeNS(null,"style", "fill: #00FFFF");
	    obj.setAttributeNS(null,"fill-opacity","0.5");
		 var posx, posy, curtrans, ctx, cty;
    posx = evt.clientX;
    posy = evt.clientY;
    document.getElementById("img1").setAttribute("x", posx * WAmp + vbCX);
    document.getElementById("img1").setAttribute("y", posy * HAmp + vbCY);
    document.getElementById("img1").setAttribute("style", "visibility: visible");
	 }
	 //鼠标移开后恢复
	 function LevelHighlightRecover(evt) {
	    var obj = evt.target;
        obj.setAttributeNS(null,"fill-opacity","0");
		 document.getElementById("img1").setAttribute("style", "visibility: hidden");
	 }
    

     function Highlight(evt) {
	 var obj = evt.target;
     
     obj.setAttribute("style", "stroke: #00FFFF; stroke-width: 150px");
	 }
	 //鼠标移开后恢复
	 function HighlightRecover(evt) {
	 var obj = evt.target;
	 obj.setAttribute("style", "stroke: #FEFEFE; stroke-width: 28.3667");
	 }
	  function closeinfotip(n)
	{
	document.getElementById('infotip'+n).setAttribute("style","visibility:hidden");
	}
